    true,nt"url": null,nt"notes": "The Special Milk Program provides milk to
    children in schools and childcare institutions who do not participate in other Federal
    meal service programs. The program reimburses schools for the milk they serve. Schools
    in the National School Lunch or School Breakfast Programs may also participate in
    the Special Milk Program to provide milk to children in half-day pre-kindergarten
    and kindergarten programs where children do not have access to the school meal programs.
